import './header.scss';

function Header() {
  return;
  <>
    <h1>Hello,</h1>
    <p>You just visited my page and if you have no idea what is it about,</p>
    <h1>
      I do <span>code</span> and <span>art</span>
    </h1>
    <p>
      and cooking and reading books and petting my dog but i don't think you will be interested in
      this.
    </p>
  </>;
}

export default Header;
